import React from "react";

class CarComponents extends React.Component {
  render() {
    return (
      <div className={this.props.model}>
        <p className="App2">{this.props.model}</p>
        <p>{this.props.spid}</p>
        <p>{this.props.mass}</p>
        <p>{this.props.color}</p>
        <br></br>
      </div>
    );
  }
}
export default CarComponents;
